import React, { useContext } from "react";

import { Button, Stepper, StepLabel, StepContent, Step, Typography, makeStyles, StepButton } from "@material-ui/core";
import { CheckoutContext } from "../CheckoutContext";

interface Props {
    steps: string[]
}

const useStyles = makeStyles((theme) => ({
    root: {
      width: '100%',
    },
    button: {
      marginTop: theme.spacing(1),
      marginRight: theme.spacing(1),
    },
    actionsContainer: {
      marginBottom: theme.spacing(2),
    },
    resetContainer: {
      padding: theme.spacing(3),
    },
  }));


export const CheckOutNavigation: React.FC<Props> = (Props) => {
    const {setStep, step} = useContext(CheckoutContext)

    const classes = useStyles()


    const handleStepClicked = (index: number) => () => {
        setStep(index)
    }

    const steps = ['Select campaign settings', 'Create an ad group', 'Create an ad'];



   return (
    <Stepper activeStep={step} orientation="vertical">

    {steps.map((label, index) => {

        const stepProps = {};
        const buttonProps = {};
       return (<Step key={label} {...stepProps}>
                <StepButton
                    onClick={handleStepClicked(index)}
                    completed={step > index ? true : false}
                    {...buttonProps}
                >
                     {label}
                </StepButton>

        </Step>)
    })}
  </Stepper>
    )
}
